import { Component } from 'react';
import logo from '../images/logo.svg';
import './App.css';

class App extends Component {
    render(){
      return (
        <div className="App">
          <header className="App-header">
            <img src={logo} className="App-logo" alt="logo" />
            <h2>Create React App</h2>
          </header>
        </div>
      );
    }
}
export default App;
